import React from 'react'
import { connect } from 'react-redux'

const Login = ({username, password}) => {
  return (
    <form onSubmit={undefined}>
      <input placeholder="username" value={undefined} name="username" type="text onChange{}" />
      <input placeholder="password" value={undefined} name="password" type="text onChange{}" />
      <input type="submit" value="Log In" />
    </form>
  )
}

// this gives me an argument coming to this component that looks like this:
{
  username: ""
  password: ""
}


const mapStateToProps = state => {
  return {
    username: state.loginForm.username,
    password: state.loginForm.username
  }
}

export default connect(mapStateToProps, ) (Login)
